function(instance, properties, context) {

    var loaderText = `data:image/gif;base64,`;

    const protocolFix = (possibleUrl) => {

        if (possibleUrl.substring(0, 4) === "http") {

            return possibleUrl;

        } else {

            return `https:${possibleUrl}`;

        }

    };


    window.addEventListener("message", (event) => {


        if (event.data.identify === "leafyMaps") {

            instance.publishState("data_from_popup", event.data.content);
            instance.triggerEvent("popup_sent_data_to_host_page");

        }

    }, false);


    if (properties.custom_popup_url) {

        var fixedIframeUrl = protocolFix(properties.custom_popup_url);

        var calculatedIframe = `<div class="holds-the-iframe"><iframe width="${properties.custom_popup_width}" height="${properties.custom_popup_height}" src="${fixedIframeUrl}"></iframe></div>`;

        var sheet = document.createElement('style');

        sheet.innerHTML =

            `.holds-the-iframe {
                background:url('${loaderText}') center center no-repeat;
              }`;

        document.head.appendChild(sheet);

    } else {

        var singleQuotedHtml = properties.custom_html.replaceAll('\"', "\'");

        var calculatedIframe = `<iframe width="${properties.custom_popup_width}" height="${properties.custom_popup_height}" srcdoc= "${singleQuotedHtml}"></iframe>`;



    }


    let options = {

        maxWidth: parseInt(properties.custom_popup_width) + properties.border_width,
        maxHeight: parseInt(properties.custom_popup_height) + properties.border_width,

    }

    instance.data[`${properties.target_marker_unique_id}`].bindPopup(calculatedIframe, options).openPopup();



}